import ArticleEvents from 'components/common/ArticleEvents';
import React, { useEffect, useState } from 'react';
import { Link, useSearchParams } from 'react-router-dom';
import styled from 'styled-components';
import EventsBody from './EventsBody';
import { fetchEventData } from './fetchEventData';
import StickeyHeader from './StickeyHeader';

const fetchEventResult = fetchEventData({
	InterestTagCategoryId: 0,
	pageIdx: 0,
	size: 0,
});

function EventsPage() {
	const testArticle = new Array(12).fill(0);

	const [searchParams, setSearchParams] = useSearchParams();
	const tag = searchParams.get('tag');
	const [baseUser, setBaseUser] = useState(
		fetchEventData({ InterestTagCategoryId: 0, pageIdx: 0, size: 0 }),
	);

	useEffect(() => {
		// HocGet('web/home/advertisments');
	}, []);

	return (
		<ComponentWrapper>
			<header>
				<Link
					to="/events/newstart"
					target="_blank"
					rel="noopener noreferrer"
				>
					<section className="event-banner" />
				</Link>
			</header>
			<EventsBody />
			<StickeyHeader />
			<ContentList>
				{/* {articleLoading ? (
					testArticle.map((value) => <SkeletonUIArticleCard />)
				) : (
					<>
						{articleList.map((value, index) => (
							<ArticleCard
								key={index}
								title={value.title}
								imgUrl={value.insightsImageUrl}
								subtitle={value.contents}
								publisherimgUrl="https://image.wanted.co.kr/optimize?src=https%3A%2F%2Ft1.daumcdn.net%2Fbrunch%2Fstatic%2Ficon%2Fios%2Ficon120.png&w=60&q=90"
								publisher={value.writer}
							/>
						))}
					</>
				)} */}

				<div className="evnetlist-content-container">
					{testArticle.map((value, index) => (
						<ArticleEvents />
					))}
				</div>
			</ContentList>
		</ComponentWrapper>
	);
}
const ContentList = styled.div`
	margin-top: 8px;
	max-width: 1060px;
	width: 87.72%;
	position: relative;
	margin: 0 auto;

	.evnetlist-content-container {
		margin: 0 -10px;
		::after {
			display: block;
			content: '';
			clear: both;
		}
	}
`;

const ComponentWrapper = styled.div`
	.event-banner {
		background-color: #fff;
		background-repeat: no-repeat;
		border-radius: 3px;
		box-shadow: inset 0 0 2px 0 rgb(0 0 0 / 10%);
		height: 300px;
		background-size: cover;
		background-position: 50%;
		position: relative;
		padding-bottom: 15%;
		background-image: url(https://image.wanted.co.kr/optimize?src=https://wanted-marketing-image.s3.ap-northeast-2.amazonaws.com/career-biz-banner/220719_event_web.jpg&w=2000&q=100);
	}
`;

export default EventsPage;
